const Nav = () => (
<div className="nav">
    <p> Whisp </p>
    <ul className="links">
      <li> <Link href='/'> shop </Link> </li>
      <li> <Link href='/about'> about </Link> </li>
    </ul>
    <style jsx> {`
			@import url('https://fonts.googleapis.com/css?family=Amiri|Source+Code+Pro');

			.nav {
			display: flex;
      }

      p {
      font-family: 'Source Code Pro';
			transform: rotate(-90deg);
			}

      .links {
      font-family: 'Source Code Pro';
      list-style: none;
      display: flex;
      text-decoration: none;
			transform: rotate(-90deg)
			}
			li {
      color: blue;
      }

      li: active {
        color: blue;
      }

      li: visited {
        color: blue;
      }

    `} </style>
    </div>
)
export default Nav
